import BigInt

struct Point448 {
    
    static let INFINITY = Point448()

    let X: BInt
    let Y: BInt
    let Z: BInt
    
    private init() {
        self.init(BInt.ZERO, BInt.ONE, BInt.ONE)
    }

    init(_ x: BInt, _ y: BInt) {
        self.init(x, y, BInt.ONE)
    }

    init(_ X: BInt, _ Y: BInt, _ Z: BInt) {
        self.X = X
        self.Y = Y
        self.Z = Z
    }

    // Reduction modulo Ed448.P
    static func modP(_ x: BInt) -> BInt {
        return x.isNegative ? Ed448.P - Ed448.reduceModP(-x) : Ed448.reduceModP(x)
    }

    // [RFC-8032] - section 5.2.4
    func add(_ p: Point448) -> Point448 {
        let A = Point448.modP(self.Z * p.Z)
        let B = Point448.modP(A * A)
        let C = Point448.modP(self.X * p.X)
        let D = Point448.modP(self.Y * p.Y)
        let E = Point448.modP(Point448.modP(C * D) * Ed448.D)
        let F = B - E
        let G = B + E
        let H = Point448.modP((self.X + self.Y) * (p.X + p.Y))
        return Point448(Point448.modP(Point448.modP(A * F) * (H - C - D)), Point448.modP(Point448.modP(A * G) * (D - C)), Point448.modP(F * G))
    }

    func double(_ n: Int) -> Point448 {
        var XX = self.X
        var YY = self.Y
        var ZZ = self.Z
        for _ in 0 ..< n {
            let B = Point448.modP((XX + YY) * (XX + YY))
            let C = Point448.modP(XX * XX)
            let D = Point448.modP(YY * YY)
            let E = C + D
            let H = Point448.modP(ZZ * ZZ)
            let J = E - Point448.modP(H * BInt.TWO)
            XX = Point448.modP((B - E) * J)
            YY = Point448.modP(E * (C - D))
            ZZ = Point448.modP(E * J)
        }
        return Point448(XX, YY, ZZ)
    }

    func negate() -> Point448 {
        return Point448(Ed448.P - self.X, self.Y, self.Z)
    }
    
    // [RFC-8032] - section 5.2.2
    func encode() -> Bytes {
        var bytes = Bytes(repeating: 0, count: 57)
        let zInv = self.Z.modInverse(Ed448.P)
        let x = Point448.modP(self.X * zInv)
        let y = Point448.modP(self.Y * zInv)
        var k = 0
        for i in 0 ..< y.magnitude.count {
            var m = y.magnitude[i]
            for _ in 0 ..< 8 {
                bytes[k] = Byte(m & 0xff)
                k += 1
                m >>= 8
            }
        }
        if x.isOdd {
            bytes[56] |= 0x80
        }
        return bytes
    }

    // Multiply the generator point
    // [GUIDE] - algorithm 3.41, window width = 4
     static func multiplyG(_ n: Bytes) -> Point448 {
        var a = Point448.INFINITY
        var b = Point448.INFINITY
        for j in (1 ..< 16).reversed() {
            var k = 0
            for i in 0 ..< n.count {
                if n[i] & 0x0f == j {
                    b = b.add(Point448.gPoints[k])
                }
                if (n[i] >> 4) & 0x0f == j {
                    b = b.add(Point448.gPoints[k + 1])
                }
                k += 2
            }
            a = a.add(b)
        }
        return a
    }

